/// <param name="_inventTransferParmLine">
///    The <c>InventTransferParmLine</c>.
/// </param>
void initFromInventTransferParmLine(InventTransferParmLine    _inventTransferParmLine)
{
    #ISOCountryRegionCodes

    // <GIN>
    InventTransferJourLine_IN   inventTransferJourLineIN;
    InventSiteGateEntryLine_IN  inventSiteGateEntryLine;
    // </GIN>

    this.TransferId             = _inventTransferParmLine.TransferId;
    this.InventTransId          = _inventTransferParmLine.InventTransId;
    this.ItemId                 = _inventTransferParmLine.ItemId;
    this.InventTransIdTransit   = _inventTransferParmLine.InventTransIdTransit;

    this.TransactionCode        = _inventTransferParmLine.TransactionCode;
    this.Transport              = _inventTransferParmLine.Transport;
    this.Port                   = _inventTransferParmLine.Port;
    this.StatProcId             = _inventTransferParmLine.StatProcId;

    this.IntrastatCommodity     = _inventTransferParmLine.IntrastatCommodity;
    this.OrigCountryRegionId    = _inventTransferParmLine.OrigCountryRegionId;
    this.OrigStateId            = _inventTransferParmLine.OrigStateId;
    this.OrigCountyId           = _inventTransferParmLine.OrigCountyId;

    this.AmountValue            = _inventTransferParmLine.AmountValue;
    this.StatisticalValue       = _inventTransferParmLine.StatisticalValue;

    this.ParmId                 = _inventTransferParmLine.ParmId;
    this.InventTransferParmLine = _inventTransferParmLine.RecId;

    this.UnitPrice              = _inventTransferParmLine.UnitPrice;

    // <GEEU>
    if (IntrastatSpecMovement_CZ::isEnabled())
    {
        this.IntrastatSpecMove_CZ        = _inventTransferParmLine.IntrastatSpecMove_CZ;
    }
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoHU]))
    {
        this.IntrastatFulfillmentDate_HU = _inventTransferParmLine.IntrastatFulfillmentDate_HU;
    }
    // </GEEU>

    // <GEERU>
    this.Price_RU               = _inventTransferParmLine.Price_RU;
    this.PriceUnit_RU           = _inventTransferParmLine.PriceUnit_RU;
    if (this.QtyReceived)
    {
        this.LineAmountReceived_RU  = _inventTransferParmLine.LineAmount_RU;
    }
    if (this.QtyShipped)
    {
        this.LineAmountShipped_RU   = _inventTransferParmLine.LineAmount_RU;
    }
    // </GEERU>

    // <GIN>
    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoIN]) && _inventTransferParmLine.inventTransferParmLine_IN().InventSiteGateEntryLine)
    {
        inventTransferJourLineIN = this.inventTransferJourLine_IN();
        inventTransferJourLineIN.InventSiteGateEntryLine = _inventTransferParmLine.inventTransferParmLine_IN().InventSiteGateEntryLine;
        this.packInventTransferJourLine_IN(inventTransferJourLineIN);
        inventSiteGateEntryLine = InventSiteGateEntryLine_IN::find(inventTransferJourLineIN.InventSiteGateEntryLine,true);
        if (inventSiteGateEntryLine)
        {
            inventSiteGateEntryLine.checkReceiptShipmentNumber();
            inventSiteGateEntryLine.ReceiptShipmentNumber = _inventTransferParmLine.TransferId;
            inventSiteGateEntryLine.update();
        }
    }
    // </GIN>

    if (BrazilParameters::isEnabled())
    {
        InventTransferJourLine_BR inventTransferJourLineBR = this.inventTransferJourLine_BR();
        InventTransferParmLine_BR inventTransferParmLineBR = _inventTransferParmLine.inventTransferParmLine_BR();
        inventTransferJourLineBR.ICMSSTCollectionPaymentMode = inventTransferParmLineBR.ICMSSTCollectionPaymentMode;
        inventTransferJourLineBR.ICMSSTCollectionPaymentNumber = inventTransferParmLineBR.ICMSSTCollectionPaymentNumber;
        inventTransferJourLineBR.RespWithholdingICMSST = inventTransferParmLineBR.RespWithholdingICMSST;
        inventTransferJourLineBR.NfeVbcstretVicmsstretTagsReported = inventTransferParmLineBR.NfeVbcstretVicmsstretTagsReported;
        this.packInventTransferJourLine_BR(inventTransferJourLineBR);
    }
}

