str queryValueInventTransId()
{
    str     s;

    s = '(';
    s += '((' + fieldStr(InventTransOrigin,InventTransId)+' == \"'+this.InventTransId+'\"))';
    s += ' || ';
    s += '((' + fieldStr(InventTransOrigin,InventTransId)+' == \"'+this.InventTransIdTransit+'\"))';

    if (this.inventTransferLine().InventTransIdScrap)
    {
        s += ' || ';
        s += '((' +fieldStr(InventTransOrigin,InventTransId)+' == \"'+this.inventTransferLine().InventTransIdScrap+'\"))';
    }

    s +=')';
    return s;
}

void setLineAmount_RU()
{
    this.LineAmountShipped_RU   = CurrencyExchangeHelper::amount(this.QtyShipped * this.Price_RU / (this.PriceUnit_RU ? this.PriceUnit_RU : 1), this.inventTransferJour_RU().CurrencyCode_RU);
    this.LineAmountReceived_RU  = CurrencyExchangeHelper::amount(this.QtyReceived * this.Price_RU / (this.PriceUnit_RU ? this.PriceUnit_RU : 1), this.inventTransferJour_RU().CurrencyCode_RU);
}

public void update()
{
    // <GEERU>
    #ISOCountryRegionCodes

    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoRU]))
    {
        this.setLineAmount_RU();
    }
    // </GEERU>

    super();

    if (SysCountryRegionCode::isLegalEntityInCountryRegion([#isoBR]))
    {
        this.SysExtensionSerializerMap::postUpdate();
    }
}

static InventTransferJourLine find(
    InventTransferId            _transferId,
    InventTransferVoucherId     _voucherId,
    LineNum                     _lineNum,
    InventDimId                 _inventDimId,
    boolean                     _forUpdate = false)
{
    InventTransferJourLine      inventTransferJourLine;

    inventTransferJourLine.selectForUpdate(_forUpdate);

    if (_transferId && _voucherId)
    {
        select firstonly inventTransferJourLine
            where inventTransferJourLine.TransferId  == _transferId &&
                  inventTransferJourLine.VoucherId   == _voucherId  &&
                  inventTransferJourLine.LineNum     == _lineNum    &&
                  inventTransferJourLine.InventDimId == _inventDimId;
    }

    return inventTransferJourLine;
}

/// <summary>
/// Finds the rec id of the invent transfer journal line.
/// </summary>
/// <param name="_recId">
/// The rec id.
/// </param>
/// <param name="_forUpdate">
/// True if the record will be update.
/// </param>
/// <returns>
/// The <c>InventTransferJourLine</c> record.
/// </returns>
public static InventTransferJourLine findRecId(RefRecId _recId, boolean _forUpdate = false)
{
    InventTransferJourLine   inventTransferJourLine = null;

    inventTransferJourLine.selectForUpdate(_forUpdate);

    if (_recId)
    {
        select inventTransferJourLine where inventTransferJourLine.RecId == _recId;
    }

    return inventTransferJourLine;
}

/// <summary>
/// Its find and Returns buffer of the InventTransferLine based on InventTransferId and InventTransferVoucherId passed.
/// </summary>
/// <param name="_inventTransferId">
/// This is used for find
/// </param>
/// <param name="_voucherId">
/// This is used for find
/// </param>
/// <returns>
/// Its returns the InventTransferLine buffer.
/// </returns>
public static InventTransferLine findInventTransLine_IN(InventTransferId           _inventTransferId,
                                                        InventTransferVoucherId    _voucherId )
{
    InventTransferJourLine  inventTransJourLine;
    InventTransferLine      inventTransferLine;

    select firstonly InventTransId from inventTransJourLine
        order by LineNum asc
        where inventTransJourLine.TransferId == _inventTransferId
           && inventTransJourLine.VoucherId  == _voucherId;

    inventTransferLine = InventTransferLine::findTransIdShip(inventTransJourLine.InventTransId);

    if (!inventTransferLine)
    {
        inventTransferLine = InventTransferLine::findTransIdReceive(inventTransJourLine.InventTransId);
    }

    return inventTransferLine;
}

